import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const profile = () => {
  const followerList = [{}]

  return (
    <>
      <Head>
        <title>프로필 | 트위치</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList header="팔로잉 목록" />
        <FollowList header="팔로우 목록" />
      </AppLayout>
    </>
  );
};

export default profile;
